import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import Listings from './Listings';

function App() {
  return (
    <div className="App">
      <h3>Skills</h3>
      <div class="container">
      <div class="row">
      <div class="col-sm">
      <Listings id="1" header="Data Science" image="https://toppng.com/uploads/preview/28-collection-of-research-clipart-png-data-analytics-courses-in-india-11562905574cmkyef8x7q.png" langList = {["Python", "SQL"]}/>
      </div>
    <div class="col-sm">
      <Listings id="2" header="Web Development" langList = {["C#", "Javascript", "HTML", "CSS", "Node.js", ".NET", "React", "Express"]} />
    </div>
    <div class="col-sm">
      <Listings id="3" header="Mobile Development" langList = {["Swift", "XCode"]} />
    </div>
    <div class="col-sm">
      <Listings id="4" header="Git" langList = {["Gitlab", "Github", "Git Command Line Interface"]} />
    </div>
    <div class="col-sm">
      <Listings id="5" header="Certifications" langList = {["IBM Data Scientist Certification", "Codecademy Data Science Certification", "Hackerrank Python Certification"]} />
    </div>
    </div>
    </div>
    </div>
  );
}

export default App;
